import React,{useState} from 'react'
import { Modal } from "react-bootstrap"; 
import './Create.css'
function Create(props) {
    const [loginModalShow, setLoginModalShow] = useState(props.show);
  
    if (!props.show) return null;
    return (
    <div> <Modal
    // show={props.show}
    // closeButton={props.close}
     show={props.show}
     closeButton={setLoginModalShow}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">Logout</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <h4>Are you sure to Logout?</h4>
      </Modal.Body>
      <Modal.Footer>
        <button onClick={() => setLoginModalShow(props.close)}>Cancel</button>
      </Modal.Footer>
    </Modal>
  </div>
  )

  
}

export default Create
